import React from "react";
import { useHistory } from "react-router-dom";

const token = localStorage.getItem("token");
var pp = localStorage.getItem("profilephoto");
var uname = localStorage.getItem("uname");

const Account = () => {
  let history = useHistory();
  if (token == null) {
    history.push({
      pathname: "/signin",
    });
  }

  return (
    <div className="container">
      <div className="row">
        <div className="col-md-2"></div>
        <div
          className="col-md-8 p-2"
          style={{ marginBottom: "100px", border: "1px solid #84c225" }}
        >
          <div className="p-2 text-center bg-dark text-light">MY ACCOUNT</div>
          <div className="container-fluid">
            <div className="row">
              <div className="col-md-2">
                <div style={{ background: "gray" }}>
                  <img src={pp} alt="Hii" style={{ borderRadius: "60%" }} />
                </div>
              </div>
              <div className="col-md-6">Bro</div>
              <div className="col-md-4">Ok</div>
              <div></div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Account;
